import React, {PureComponent} from 'react'
import './App.scss';
import Shop from '../../page/shop/shop.js'
import AboutUs from '../../page/aboutUs/aboutUs.js'
import Menu from '../menu/menu.js'
import ShoppingBasketConsumer from '../shoppingBasketConsumer/shoppingBasketConsumer.js'
import { BrowserRouter, Switch, Route, Redirect, Router } from "react-router-dom";

const NumberContext = React.createContext();

export default class App extends PureComponent {


  render() {

    return (

      <main>
        <NumberContext.Provider value={5}>
        <BrowserRouter>
          <Menu />
          <Switch>
            <Route path="/" exact children={<Shop />} />
            <Route path="/aboutus" children={<AboutUs />} />
            <Redirect to="/" />
          </Switch>
        </BrowserRouter>
        </NumberContext.Provider>
      </main>

    );
  }
}
